import { memo, useState, useEffect } from 'react'
import { Sidebar, Menu, MenuItem, SubMenu, useProSidebar } from 'react-pro-sidebar';
import { englishAdminMenu, vietnameseAdminMenu } from '../../Languages/AdminMenu';
import { AiFillCaretLeft, AiFillCaretRight } from 'react-icons/ai'
import Dashboard from '../../images/dashboard.png'
import Suppliers from '../../images/supplier.png'
import Services from '../../images/services.png'
import Booking from '../../images/booking.png'
import Customers from '../../images/customer.png'
import Partners from '../../images/partners.png'
import Feedback from '../../images/feedback.png'
import ServiceConfirm from '../../images/service_confirm.png'
import './AdminHome.scss'

function AdminHome({ languageSelected, children }) {
    let adminMenuLabel = (languageSelected === 'EN' ? englishAdminMenu : vietnameseAdminMenu)
    const pathName = window.location.pathname

    const { collapseSidebar } = useProSidebar();
    const [isOpenSidebar, setOpenSidebar] = useState(true)

    const handleClickOpenCloseSidebar = () => {
        setOpenSidebar(!isOpenSidebar);
        if (isOpenSidebar) {
            document.getElementById('left-hide-content').style.display = 'none'
        }
        else {
            document.getElementById('left-hide-content').style.display = 'block'
        }
        collapseSidebar();
    }

    return (
        <div className='container home-main'>
            <div className='home-partner-main d-flex'>
                <div className='w-25' id='left-hide-content' />
                <div className='fixed-menu-sidebar-admin'>
                    <Sidebar className='menu-sidebar-admin'>
                        <Menu>
                            <MenuItem className='menu-item-left' onClick={handleClickOpenCloseSidebar} icon={isOpenSidebar ? <AiFillCaretLeft /> : <AiFillCaretRight />} />
                            <MenuItem icon={<img className='image-icon-sidebar' src={Dashboard} />}
                                className={`menu-item-left ${pathName === '/admin/dashboard' && 'selected-menu-item-admin'}`}>
                                {adminMenuLabel.txtDashboard}
                            </MenuItem>
                            <SubMenu icon={<img className='image-icon-sidebar' src={Suppliers} />} className='menu-item-left menu-sub-main' label={adminMenuLabel.txtSuppliers}>
                                <MenuItem className={`menu-item-left item-sub-menu ${pathName === '/admin/suppliers/accommodation' && 'selected-menu-item-admin'}`}>
                                    {adminMenuLabel.txtAccommodation}
                                </MenuItem>
                                <MenuItem className={`menu-item-left item-sub-menu ${pathName === '/admin/suppliers/entertainment' && 'selected-menu-item-admin'}`}>
                                    {adminMenuLabel.txtEntertainment}
                                </MenuItem>
                                <MenuItem className={`menu-item-left item-sub-menu ${pathName === '/admin/suppliers/restaurant' && 'selected-menu-item-admin'}`}>
                                    {adminMenuLabel.txtRestaurant}
                                </MenuItem>
                            </SubMenu>
                            <SubMenu icon={<img className='image-icon-sidebar' src={Services} />} className='menu-item-left menu-sub-main' label={adminMenuLabel.txtService}>
                                <MenuItem className={`menu-item-left ${pathName === '/admin/services/tour' && 'selected-menu-item-admin'}`}>
                                    {adminMenuLabel.txtTourProduct}
                                </MenuItem>
                            </SubMenu>
                            <MenuItem icon={<img className='image-icon-sidebar' src={Booking} />} className={`menu-item-left ${pathName === '/admin/booking' && 'selected-menu-item-admin'}`}>
                                {adminMenuLabel.txtBooking}
                            </MenuItem>
                            <MenuItem icon={<img className='image-icon-sidebar' src={Customers} />} className={`menu-item-left ${pathName === '/admin/customers' && 'selected-menu-item-admin'}`}>
                                {adminMenuLabel.txtCustomer}
                            </MenuItem>
                            <MenuItem icon={<img className='image-icon-sidebar' src={Partners} />} className={`menu-item-left ${pathName === '/admin/partners' && 'selected-menu-item-admin'}`}>
                                {adminMenuLabel.txtPartner}
                            </MenuItem>
                            <MenuItem icon={<img className='image-icon-sidebar' src={Feedback} />} className={`menu-item-left ${pathName === '/admin/feedback' && 'selected-menu-item-admin'}`}>
                                {adminMenuLabel.txtFeedback}
                            </MenuItem>
                            <MenuItem icon={<img className='image-icon-sidebar' src={ServiceConfirm} />} className={`menu-item-left ${pathName === '/admin/service-confirm' && 'selected-menu-item-admin'}`}>
                                {adminMenuLabel.txtServiceConfirm}
                            </MenuItem>
                        </Menu>
                    </Sidebar>
                </div>
                <div className='container list-service-main'>
                    <div className='content-right-admin w-75'>
                        {children}
                    </div>
                </div>
            </div>
        </div>
    )
}

export default memo(AdminHome)
